import { useEffect, useState } from 'react';
import MathchCard from '../../matchcards/MatchCard';
import './dontMiss.scss';
import axios from 'axios'
import Loading from '../../loading/Loading';

const DontMissList = () => {
    const [data,setData] = useState(null);
    const [isLoading,setLoading] = useState(true);
    const match = useEffect(async()=>{
        try{
            const {data} = await axios.get('/matches');
            setData(data)
            setLoading(false);
            return data[0];
        }catch(err){
            console.log(err);

        }

    },[])

    return ( 
        <div className="dontMissList">
            <div className="titleWrapper">
                <h1 className="title">
                    Don't Miss
                </h1>
            </div>
            {isLoading?<Loading/> : <MathchCard match= {data[0]} />}
        </div>
     );
}
 
export default DontMissList;
